import React, { useState } from 'react'


const App =() => {

  const [num,setNum] =  useState(0);

  const incrementNum = () =>{
    setNum(num+1);
  }

  const decrementNum =() =>{
    if(num===0){
      alert('Zero limit reached');
    }else{
      setNum(num-1);
    }
  }


  return (
    <>
      <div>
         <div>
            <h1>{num}</h1>
            <div>
              <button onClick={incrementNum}>Increment</button>
              <button onClick={decrementNum}>Decrement</button>
            </div>
         </div>
      </div>
    </>

  );
}

export default App;
